import { getAssetFromKV, mapRequestToAsset } from '@cloudflare/kv-asset-handler'

/**
 * The DEBUG flag will do two things that help during development:
 * 1. we will skip caching on the edge, which makes it easier to
 *    debug.
 * 2. we will return an error message on exception in your Response rather
 *    than the default 404.html page.
 */
const DEBUG = false

addEventListener('fetch', event => {
  try {
    event.respondWith(handleEvent(event))
  } catch (e) {
    if (DEBUG) {
      return event.respondWith(
        new Response(e.message || e.toString(), {
          status: 500,
        }),
      )
    }
    event.respondWith(new Response('Internal Error', { status: 500 }))
  }
})

async function handleEvent(event) {
  const url = new URL(event.request.url)

  try {

    // handle 301 recommends redirects
    const path = url.pathname
    const location = redirectMap.get(path)
    if (location) {
      return Response.redirect(location, 301)
    }

    // handle 302 recommends redirects
    var strippedParameters = url.href.split('?')[1];
    var parmeterDivider = "?";

    const locationTempComissionJunction = redirectTempMapComissionJunction.get(path)
    const locationTempHasOffers = redirectTempMapHasOffers.get(path)

    const locationTempImpact = redirectTempMapImpact.get(path)
    const locationTempPartnerize = redirectTempMapPartnerize.get(path)
    const locationTempHasAffiliatesgetpaid = redirectTempMapAffiliatesgetpaid.get(path)
    const locationTempSellhealth = redirectTempMapSellhealth.get(path)
    const locationTempSkimlinks = redirectTempMapSkimlinks.get(path)



    // comission junction
    if (locationTempComissionJunction) {
      return Response.redirect(locationTempComissionJunction, 302)
    }

    // has offers
    else if(locationTempHasOffers){
      return Response.redirect(locationTempHasOffers, 302)
    }

    // impact
    else if(locationTempImpact){
      return Response.redirect(locationTempImpact, 302)
    }

    // partnerize
    else if(locationTempPartnerize){
      return Response.redirect(locationTempPartnerize, 302)
    }

    // affiliates get paid
    else if(locationTempHasAffiliatesgetpaid){
      return Response.redirect(locationTempHasAffiliatesgetpaid, 302)
    }

    // sell health
    else if(locationTempSellhealth){
      return Response.redirect(locationTempSellhealth, 302)
    }

    // skim links
    else if(locationTempSkimlinks){
      return Response.redirect(locationTempSkimlinks, 302)
    }

    const locationTemp = redirectTempMap.get(path)
    // other redirects
    if (locationTemp) {
      return Response.redirect(locationTemp, 302)
    }

    // redirect index.html urls
    const indexPortion = url.pathname.substr(url.pathname.length - 11)
    if (indexPortion == "/index.html") {
      return Response.redirect("https://" + url.hostname + url.pathname.slice(0, -11), 301)
    }

    // trailing slash redirect
    const lastCharacter = url.pathname.charAt(url.pathname.length - 1)
    if (lastCharacter == "/" && url.pathname != "/") {
      return Response.redirect("https://" + url.hostname + url.pathname.slice(0, -1), 301)
    }
    const lastTwoCharacters = url.pathname.substr(url.pathname.length - 2)
    if (lastTwoCharacters == "//") {
      return Response.redirect("https://" + url.hostname + url.pathname.slice(0, -2), 301)
    }

    // redirect urls with uppercase urls
    var detectUpperCase = /[A-Z]/g;
    if(detectUpperCase.test(url.pathname) && !url.pathname.includes("assets/") && !url.pathname.includes("geodata/")){
      return Response.redirect("https://" + url.hostname + url.pathname.toLowerCase(), 301)
    }

    // default cache control
    let cacheControl = {
      browserTTL: null, // do not set cache control ttl on responses
      edgeTTL: 2 * 60 * 60 * 24, // 2 days
      bypassCache: false, // do not bypass Cloudflare's cache
    }

    //caching for assets
    if (url.pathname.includes("assets-dist/") || url.pathname.includes("assets/")) {
      cacheControl = {
        browserTTL: 31536000, // do not set cache control ttl on responses
        edgeTTL: 2 * 60 * 60 * 24,
        bypassCache: false, // do not bypass Cloudflare's cache
      }
    }

    // this is the main request to the backend
    const page = await getAssetFromKV(event, { cacheControl: cacheControl })

    // allow headers to be altered
    const response = new Response(page.body, page)

    if (url.pathname.includes(".pdf")) {
      response.headers.set('x-robots-tag', 'noindex')
    }

    // redirect non https to https
    if(url.protocol == "http:"){
      return Response.redirect("https://" + url.hostname + url.pathname, 301)
    }

    return response
  } catch (e) {
    // if an error is thrown try to serve the asset at 404.html
    if (!DEBUG) {
      try {
        let notFoundResponse = await getAssetFromKV(event, {
          mapRequestToAsset: req => new Request(`${new URL(req.url).origin}/404.html`, req),
        })

        return new Response(notFoundResponse.body, { ...notFoundResponse, status: 404 })
      } catch (e) {}
    }

    return new Response(e.message || e.toString(), { status: 500 })
  }
}

